css:
@-moz-document domain("ent.poitou-charentes.fr") {
body section.main {
    background-color:#1b1b1d;
}

.logo {
	background: url("http://image.noelshack.com/fichiers/2017/21/1495918549-logolol.png") center no-repeat;
	height: 64px;
    width: 236px;
    margin: 0;
    background-size: contain;
}
.navbar {
    background-color: #1e1e20;
}

.material {
    background-color: #1b1b1d;
}
.notification {
    background-color: #222225;
}
.widget-container {
    background-color: #222225;
}
.widget-container:hover {
    background-color: #222225;
}
h1 {
    color: #aaaab6;
}
a {
    color: #aaaab6;
}
.notification article>.row {
    color: #5d5d5d;
}
.no-style {
    color: #aaaab6;
}
.message {
    background-color: #1d1d1d;
    border-left: 10px solid #aaaab6;
    color: #aaaab6;
}
.calendar.widget .current-month-header {
    padding-top: 5px;
    color: #aaaab6;
    top: 0;
}
.ng-binding {
    color: #aaaab6;
}
.calendar.widget .content h2 {
    color: #aaaab6;
}
recorder .elapsed-time {
    color: #aaaab6;
}
textarea {
    background-color: #1d1d1d;
    color: #aaaab6;
}

.left-open{
	background-color: #1d1d1d;   
}

.actions{
	background-color:#1d1d1d;
}

.notification div.notification-actions>.actions i {
    color: #aaaab6;
}

.notification article .avatar img, .notification article .avatar i.system-avatar {
    height: 75px;
    width: 75px;
    max-width: none;
    display: block;
    border-radius: 15%;
    border: 1px solid rgb(239, 137, 0);
}
}
